INSERT INTO `crisis` VALUES (1,'both','ALERT: Authorised Termination rates are at 0. Rectify immediately! This information is classified GREEN.'),(2,'both','Beloved Citizens! The contract for transtube maintenance is up for tender today! Please monitor the situation and decide on the best service group to maintain the tubes. Contract is clearance ORANGE.'),(3,'both','Alert! RD Project ##SUB## has gone missing from location databanks. Find and recover immediately. ##SUB## is classified INDIGO.'),(4,'both','Citizens! ##CIT-V-TR## is due for erasure later today. Make sure his name is purged from all databanks before his public erasure.'),(5,'both','Citizens! RD Project ##SUB## has been escalated. Please decide on a plan of action. ##SUB## is classified GREEN.'),(6,'both','Citizens! Oversee the installation of RD Project ##SUB##. ##SUB## is clearance INDIGO.'),(7,'straight','Citizens! A Communist superweapon has been deployed around the Complex. Decide on course of action. This information is classified GREEN.'),(8,'both','Citizens! Compliance Index falling at unacceptable rate. Please identify cause and rectify. This information is classified YELLOW.'),(9,'both','ALERT! Major traffic disturbances detected in Transtube ##ZON##-##SUB##. Rectify situation and decide who is responsible for damages.'),(10,'straight','Alert! Information has surfaced that a major terrorist attack is to take place this daycycle. Prevent this attack at all costs. Information classified BLUE.'),(11,'both','Citizens! ##ZON## reactor ##SUB## is ready to go online. Please use this opportunity to raise morale across the sector.'),(12,'both','Alert! Enemy invasion force at edge of sector! Identify and eliminate immediately!'),(13,'classic','Alert! Large flooding occuring on subbasements 15-28 at location ##SUB##. Identify and fix source of flooding immediately.'),(14,'both','Alert! Hygiene in ##ZON## at record low levels! Identify areas for improvement and fix immediately! Information classified YELLOW.'),(15,'both','The popular Hero of our Complex ##CIT-B-1##-3 has been found guilty of communist sympathising. Organise their erasure without damaging morale.'),(16,'both','Alert! IntSec item 214-##SUB## is currently missing. Find and recover this item. 214-##SUB## is classified VIOLET.'),(17,'both','Alert! ##CIT-V-1## holding out against commie force in the MuchoMeat plant. Rescue and recover ##CIT-V-1## unharmed.'),(18,'both','Citizens! RD Project ##SUB## is complete and ready for deployment. Test ##SUB## with a suitable project. Projects must be approved by concesus.WANTON BROTH is classified INDIGO.'),(19,'both','Error. Code 1789. Additional processing power required. Please find space for and construct additional processing CompNodes to bring the total up from 8 to 20.'),(20,'both','Alert! Information has surfaced that a major terrorist attack is to take place this daycycle. Prevent this attack at all costs. Information classified BLUE.'),(21,'both','Assertion Error. Testing [DELETED FOR SECURITY REASONS]. Statement: Communism is good for citizens. Legalise Communism. This information classified ULTRAVIOLET.'),(22,'both','Alert! Citizen Vicky-B must me made to disappear this daycycle. Organise while keeping up her public appearances and career. This issue classified VIOLET.'),(23,'both','Citizens! A Communist superweapon has been deployed around the Complex. Decide on course of action. This information is classified GREEN.'),(24,'both','Assertion Error. Testing [DELETED FOR SECURITY REASONS]. Citizens! Organise a mock Communist attack to assess the sector\'s prepardness. Until the exercise is complete, situation is classified INDIGO.'),(25,'both','Alert! Citizen ##CIT-V## was detained by agents of Beta Complex on their last mission. Negotiate with ##CIT-U## of Beta Complex and return ##CIT-V## to us. Situation classified BLUE.'),(26,'both','Alert! Paperwork Quota down 84%! Hygiene down 29%! Analyze and remediate situation!');
