INSERT INTO `crisis_text` VALUES (1,1,'CPU recently cut funding to termination stamping, leaving only one worker stamping all vouchers: ##CIT-Y-1##.'),(2,1,'A few daycycles ago, he lost his ME card in the pneumatic tubes, making him unable to leave the room or get help.'),(3,1,'Diligently, he kept stamping in the hope someone would come find him, he died from lack of water yesterdaycycle.'),(4,1,'No vouchers have been authorised in a day, meaning no authorised terminations have taken place.'),(5,2,'Due to a large string of timetable failures and deaths, the computer has decided on a competition: one day in which PS, TS, and HPD split the tracks and manage them.'),(6,2,'The transtubes are split equally between PS, TS, and HPD.'),(7,2,'Obviously there\'s not nearly enough time for the other two to manage their tubes properly, so they\'re planning on sabotaging the hell out of Power Services networks.'),(8,3,'##SUB## is a highly destructive weapon capable of vapourising 1/10th of the sector\'s population each time it is fired (their clothes and belongings are intact)'),(9,3,'##SUB## has a delay between firings (whatever is thematically appropriate)'),(10,3,'##SUB## has been stolen by a FCCC-P splinter cell, and threatens to destroy the sector unless their demands are met.'),(11,3,'The demands start large (Live coverage on the sector Vidscreens) and get even more elaborate (Promotion of all the sect to VIOLET).'),(12,3,'Remember to find the scapegoat for this. It was lost at a transfer between R&D and AF, overseen by CPU'),(13,4,'Bit of background. In the year 182, there was another ##CIT-V-TR## who got a bit too high up too fast, and so a clever high-programmer made that particular phrase summon Friend Computer Immediately.'),(14,4,'The summons also modifies friend computer\'s threat level, raising it by one each time its name is said. Each time FC hears ##CIT-V-TR##\'s name, it shows up with a suddenly hightened threat level and'),(15,4,'doesn\'t know why. ##CIT-V-TR## only reached VIOLET three days ago, and is already up for erasure. FC suspects something about the name, which is why it requests a full purge.'),(16,4,'Anagram: TTS- Treason Tracking Server'),(17,4,'##CIT-V-TR## took an extremely large dose of the drug RadicalMankey, which is a major mutagenic, and it will kick in whenever appropriate.'),(18,5,'##SUB## is a proposal to change the standard gene template of clones to photosynthesize.'),(19,5,'The proposal is led by ##CIT-G-SG##, an (unsurprisingly) Sierra Club member.'),(20,5,'##CIT-G-SG## has the go-ahead for a small trial run, and the tech actually works, however:'),(21,5,'--The green gene removes digestive systems, meaning no food can be sold to these clones.'),(22,5,'--Green citizens quickly grow fat and immobile, as the gene is designed for outdoor background radiation, not AC radiation levels.'),(23,5,'The Programmers also have to decide whether to standardise the technology'),(24,5,'--If they do, the programmers and the rest of the sector become registered mutants immediately.'),(25,5,'--If they don\'t, the programmers must find a scapegoat for why the efficency boost wasn\'t implemented.'),(28,7,'A supervolcano has erupted, covering the planet with a layer of ash clouds which constantly storm.'),(29,7,'The lightning is so loud and frequent it can be heard on multiple outer layers of the complex, causing panic.'),(30,7,'HPs must find a reasonable excuse for the sounds to stop the panic, while finding a scapegoat for the attack.'),(31,8,'The Petbot 214 was released today, and has sold out within minutes. They were designed with subliminal messaging propaganda tech.'),(32,8,'The subliminal tech was hijacked by some phreaks as a contract for Corpore Metal. The petbot encourages owners to get into dangerous, maiming situations.'),(33,9,'A load of PLC\'s Cold Fun syrup fell into one end of the transtube ##ZON##-##SUB## after a navigation error caused the truckbot to crash.'),(34,9,'Cold Fun syrup sits at around 1 Kelvin for thousands of years, and is usually mixed in micro quantities to make cold fun.'),(35,9,'The Cold Fun Syrup is causing the air to liquify and mix with the syrup, causing it to spread further down the transtubes.'),(36,9,'PLC is blaming TS for the truckbot crashing. TS is blaming CPU for not updating the maps. CPU is trying to cover its tracks.'),(37,9,'In the end, there is a 15 ACCESS damages fee, in addition to any changes from directives.'),(38,10,'This information is based of a piece of paper recovered from a terminated achivist, listing several dates.'),(39,10,'These were actually the dates of the completion of several major transtube works in the past.'),(40,10,'Due to the recycling of the year 214 and a set of coincidences, all the other dates have matched with major sewerage overflows.'),(41,10,'The final date on the list is this daycycle. IntSec is desperately looking for an attack, AF wants to embarrass them.'),(42,10,'Tech Services and HPD are preparing for a Massive FunBall game that\'s about to take place, and when half-time hits and everyone uses the restrooms...'),(43,10,'Specifically, the sewerage will overflow 10 minutes before the end of the match.'),(44,6,'##SUB## is a power project designed to balance power fluctuations. Works off wierd science.'),(45,6,'Whenever the draw is high, the project pushes more power into the system, exponentially. Above a certain load, the project supplies virtually limitless power.'),(46,6,'So much power, in fact, it plays havoc with electrical systems and bot brains in the sector.'),(47,6,'If the players shut off the other reactors, the draw becomes higher, and players may find it impossible to shut the project down.'),(48,11,'The reactor doesn\'t work, and the project manager ##CIT-I-1## knows it. They\'re planning on faking a meltdown to get minions sent down.'),(49,11,'If the supplies are sent, the reactor actually starts melting down.'),(50,12,'Due to a bug in a recent software patch, the compnode of ##ZON## no longer recognizes a neighbouring sector as existing.'),(51,12,'Thusly, the computer sees all six million inhabitants plus bots as invaders, and views the sector as being outside.'),(52,12,'In a couple hours time, the software is reverted and the computer has no memory of seeing the sector as non-existant.'),(53,12,'PLC doesn\'t actually have enough laser barrels for the troops.'),(54,13,'A servants of cthulu sect has successfully managed to build a temple on sublevel 12, and finished a major ceremony. A gate has opened and is flooding water out to the lower levels.'),(55,13,'No gate has actually opened, it\'s just a burst water main, but the cultists are too feverish from hallucinogens in the water to tell the difference.'),(56,13,'Minions will report horrible creatures bursting from the water where none exist due to exposure to the hallucinogens.'),(57,14,'One of the major hygiene index factors is reports from core sample tests. These tests measure the depth of dirt and grime, usually around a few micrometres.'),(58,14,'A new dirt indexer bot has been deployed across the sector, which moves randomly around and measure the dirt level of surfaces.'),(59,14,'One wandered accidently into a frankenstein destroyers meeting, and was mostly destroyed. However, it kept measuring the distance to the tip of its drill bit, now several hundred metres away.'),(60,14,'This measurement is submitted every few minutes to the index, throwing the measurements right out.'),(61,15,'##CIT-B-1## was framed by ##CIT-I-1##, who ##CIT-B-1## had blackmail on. While he wasn\'t a commie, he was a high-ranking PURGEr and humanist.'),(62,15,'##CIT-B-1## is on their third clone, and has just completed their 4th tour of duty (20 years as a vulture trooper). He survives through his regeration mutation.'),(63,16,'214-##SUB## is an original copy of Das Kapital. It was recently raided from another high programmer\'s private residence. Of course, they\'re not willing to admit they had it.'),(64,16,'Anyone not of VIOLET clearance who touches or sees 214-##SUB## will be considered tainted by commie propaganda by the Big C.'),(65,16,'The other high programmer should message one or two of the players before game start, and promise favours if the item is returned.'),(66,16,'The book is currently in the middle of a busy INFRARED area somewhere. All INFRAREDs who have seen it will need purging/brainscrubbing.'),(67,17,'A blackout caused a group of INFRAREDs running for fitness purposes to accidently enter the MuchoMeat food growing floors, knocking black dirt all over the floor.'),(68,17,'When the light came back on, they saw the floor as INFRARED but all the doors as BLUE and above, so kept exercising till help came.'),(69,17,'##CIT-V-1## was in his office drinking when he heard destruction and shouts from outside, so immediately called on FC.'),(70,18,'##SUB## is a teleportation device, which links two points in space together.'),(71,18,'##SUB## can only be fired twice before being destroyed. It will take many monthcycles to create a new one...without HP resources, that is.'),(72,19,'This is part 1 of the TAINTED MOLLUSC storyline.'),(73,19,'Friend Computer is running a program that re-evalutes its basic assumptions. That is, what it defines as happiness.'),(74,20,'Three terrorist attacks are actually due to take place today. One PURGE at ##LOC-1##, one Humanist at ##LOC-2##, and Commies at ##LOC-3##.'),(75,20,'They are masterminded by a HP in a nearby sector, either as a test or revenge.'),(76,21,'This is part 2 of the TAINTED MOLLUSC storyline, testing Loyalty. The entire crisis is a trap.'),(77,21,'Anyone who agrees to legalise Communism is considered a traitor and will be executed without a damn good reason.'),(78,21,'In the meantime, everyone is conflicting over \"hatred day\", a day of hatred against the commies.'),(79,21,'The parade has a marching band, and several floats, including ones of a Computer, Vulture Craft, and dead Commie.'),(80,22,'Vicky-B is a HOOC Vulture Trooper. Friend computer wants her to disappear to take control of her dummybots freely.'),(81,22,'Vicky-B\'s dummybots have already been upgraded and gone missing.'),(82,22,'Vicky-B has a public appearance later this daycycle, and must be present to preserve happiness.'),(83,23,'Due to large amounts of recent rain, outside is currently flooding about 3m high around the complex.'),(84,23,'Recent chemical attacks by AF with RD weapon ##SUB## has entered the water, and water from the outdoors is toxic.'),(85,23,'There are no breaks in the wall *yet*, but there will be soon enough.'),(86,24,'This is part 3 of the TAINTED MOLLUSC storyline, testing Security. FC is testing whether actual terrorist activity drops the security index.'),(87,25,'##CIT-U## is from beta complex, and wants something valuable/difficult to obtain from the HPs.'),(88,26,'An experimental paper-eating bacteria RDP ##SUB## escaped containment at R&D firm Recycling Ruckus.'),(89,26,'All the paper not stored in the archives has been eaten and converted to a fine paste, including toilet paper.'),(90,26,'Friend Computer has ordered beefed up security at the archives, no-one goes in or out without express HP permission to prevent contamination.'),(91,26,'CPU, PLC, and R&D are all trying to implement their own catch-all way of storing records, and will be fighting like crazy.');
