INSERT INTO `news` VALUES (1,'Congratulations! You may be a winner! Call 1800-244-7226!',NULL),(2,'Alpha Complex Space Agency landing declared hoax! Execution of agency head ##CIT-I-RD## scheduled for 6.',NULL),(3,'Borders to neighbouring sectors found lacking. ##CIT-I-IS##: \"It\'s like any old RED could get through, they will be fortified!\"',NULL),(4,'New craze \"planking\" declared waste of time and treasonous.',NULL),(5,'There was no shuddering of Alpha Complex. Alpha Complex is as stable as ever. Those who believe otherwise are encouraged to contact IntSec.',NULL),(6,'Survey on pronunciation of \"gif\" complete. 100% of respondents say soft-g. In unrelated news, terminations doubled yesterday.',NULL),(7,'##CIT-V-TR##\'s show trial and erasure due for 80:00 SCT todaycycle!',4),(8,'Painkiller RadicalMankey classified treasonous due to unintended side effects.',4),(9,'New CPU manager sends 800 staff to the re-employment office.',1),(10,'Alternative Power Firm Strike-Me-Not reports a 3000% increase in power generation this daycycle!',7),(11,'The new Petbot 214 released today, sells out in minutes!',8),(12,'CPU reports the air per person index has risen 4% in the last month!',9),(13,'Sold-out UltraSuperMegaBowl funball game between USS Patriots and MBB Ballers live todaycycle on Channel 5!',10),(14,'Power forecast: rolling brownouts down by 28%, blackouts down 41%.',6),(15,'A new reactor to be completed today! Citizens rejoice!',11),(16,'Serve your Complex! Battle the Commie Threat! Bonus Hot Fun! Enlist Today!',12),(17,'Friendly Ollie-U saves sector YRU yet again! Citizens Rejoice!',NULL),(18,'ChocolateLyke ration for INFRAREDs increased yet again! ##CIT-I-PL##: \"Once again, the war on production is won!\"',NULL),(19,'Frank-U destroys fifteen communist strongholds, says end in sight for war on terror.',NULL),(20,'Terrorist bomb unlawfully terminates 180 clones, IntSec urges terrorists to hand themselves over before it becomes erasable.',NULL),(21,'Water rations to be decreased 30% due to increased B3 usage.',13),(22,'New dirt indexer bots promise faster hygiene index response times!',14),(23,'Secret Society activity up 12%. Register your society affiliation today for bonus hot fun!',NULL),(24,'Hero Of Our Complex ##CIT-B-1## completes fourth successful tour of duty!',15),(25,'Bright Vision Reducation Centres announce the opening of a new location due to increasing needs!',16),(26,'Rolling blackout centred on RIO sector hit early this morning, productivity hit of 3.81%.',17),(27,'New proposal being investigated to outlaw sleep to raise efficiency.',NULL),(28,'##ZON## funball team under investigation for poor performance. ##CIT-I-IS##: \"No-one but a commie could perform so badly\".',NULL),(29,'SIB Splasheroony fun park boasts record attendence, despite having no water.',NULL),(30,'Friend Computer processing delay set to decrease in the next few weekcycles.',19),(31,'The Hatred Day Parade, live tonight at 8000SCT!',21),(32,'Vicky-B credited with her eleventh HOOC award!',22),(33,'Alternative Power Firm Strike-Me-Not reports a 3000% increase in power generation this daycycle!',23),(34,'Underplex reclaim up 4.8% yearcycle on yearcycle.',NULL),(35,'Bouncy Bubble Beverage increases artificial sweetener content to 81.4%',NULL),(36,'FizzWizz updates its recipe, now with extra Fizz!',NULL),(37,'Defence system update goes smoothly, minimal wrongful terminations.',NULL);
