INSERT INTO `sgm` VALUES (1,'The grunts are getting restless. Make sure at least two infantry units are given something to do.',1,NULL),(2,'The budget for the new Mark V Warbot is tight. We need an R&D team and half a ton of reactor fuel to attempt to turn it on.',1,NULL),(3,'Efficiency is down 15.7%. Find a way to increase it. It doesn\'t matter what it is, it\'ll all balance out in the end.',2,NULL),(4,'Housing in ##ZON## is oversubscribed by 21%. Either build more housing or reduce demand.',3,NULL),(5,'We\'ve overproduced on ##RES-1## by six months. Find a use for the excess ##RES-1##.',4,NULL),(6,'We have a machine. We don\'t know what it does. Turning it on needs unfettered access to a reactor. We want to turn it on.',7,NULL),(7,'Our contract to rebuild sector ZQD is behind schedule. We need another couple of construction teams but don\'t let anyone know we\'re using them to finish ZQD.',5,NULL),(8,'We\'ve got a huge excess of spent fuel rods. Find a place to put them, please?',6,NULL),(9,'We\'re having trouble storing all the nukes. Either use a few or find us a new storage area.',1,NULL),(10,'The jackbooted idiots are blaming us for no termination vouchers being dispatched, make sure the blame falls on them and not on us.',2,1),(11,'Those idiots in CPU haven\'t sent us any termination vouchers for the last daycycle. Find out why and make sure they take the blame.',8,1),(12,'We want this contract but haven\'t the time to prepare...make sure Power Services\' tubes stop working and get us that contract.',5,2),(13,'The money we could get from this contract, not to mention the extra housing space. Do whatever it takes to get us the contract.',3,2),(14,'It\'s not our fault there were so many problems with the Transtube timetables! Make sure we keep this contract, or we\'re all toast.',6,2),(15,'Power Services have never given our troops free rides. Make sure whoever gets the contract promises free rides to Armed Forces grunts.',1,2),(16,'We were ambushed while getting the weapon from R&D. Make sure we don\'t get embarrased over this.',1,3),(17,'We filed the RDP ##SUB## paperwork as complete before the exchange was ambushed. Make sure the exchange is completed before the end of the daycycle.',2,3),(18,'There\'s a small problem we\'ve located with RDP ##SUB##, once it gets fired it can\'t be turned off. Destroy the device and make sure no-one else finds out about this little flaw.',7,3),(19,'##CIT-V-TR##\'s erasure has to go off without a hitch. The Big C\'s twitchy enough as it is.',3,4),(20,'Due to constraints, we can\'t actually remove ##CIT-V-TR##\'s name from the databanks until after their erasure, or it\'ll crash the TTS. Make sure it doesn\'t crash.',2,4),(21,'The Big C seems to have a sore spot for ##CIT-V-TR##, and the TTS isn\'t tracking why. Make sure the trial goes off fine, but delay the erasure so we can use \'em as bait.',8,4),(22,'##CIT-V-TR##\'s erasure is due for 80:00, but we want it pushed back to 90:00 for...reasons. We also want his body afterwards, get it to us.',7,4),(23,'RDP ##SUB## is one of our best projects, and it actually works! Get it standardized sector-wide.',7,5),(24,'If RDP ##SUB## gets standardised we\'ll lose at least half our revenue. Make sure it doesn\'t make the cut.',4,5),(25,'RDP ##SUB## getting standardised means we can sell space in our reactors for growth! Get in standardised!',6,5),(26,'The nitwits at Power Services want RDP ##SUB## standardised for some reason. Make sure it doesn\'t happen.',5,5),(27,'If RDP ##SUB## is standardised, we won\'t be able to easily push drugs to the population. Stop it at all costs',3,5),(28,'If R&D\'s new gene is standardised, we can classify most of the sector as unregistered mutants and push our rates through the roof! Get it done.',8,5),(29,'Current projections of RDP ##SUB## show an efficiency increase of 180%! Get it standardised!',2,5),(33,'This attack must be from Beta Complex. We must march upon Beta Complex immediately!',1,7),(34,'This attack will lead to war if we don\'t act soon. Prevent a war with Beta Complex breaking out until we find the cause.',8,7),(35,'Our grid is almost overloaded! I can\'t believe I\'m saying this...but we need clones to use more power immediately!',6,7),(36,'There\'s a sudden drop of happiness in multiple subsectors. We need it cleared up pronto.',3,7),(37,'The Petbot 214 has a bit of a flaw, but make sure it doesn\'t get banned. It\'s set to have huge sales!',4,8),(38,'The Petbot 214 is a hit, but could use a few new features. Make sure the next production run encourages people to watch \"Late Night with Conan-O-BRN\"',3,8),(39,'The release of the Petbot 214 is ruining our metrics. Get it removed from sale however you can.',2,8),(40,'The new Petbot requires huge amounts of power, and needs to be rechared every two hours. The grid can\'t handle it, either get us more power or remove the petbots.',6,8),(41,'The concentration of petbots is at an exact level required for data gathering. Don\'t have them recalled, but don\'t let the next production run complete.',7,8),(42,'The truckbot with cold fun syrup crashed in ##SUB##, make sure we don\'t take the blame or have to pay any damages.',4,9),(43,'Tunnel ##SUB## was a clear run on the map! Make sure CPU wear the blame for the Cold Fun syrup truckbot crash.',5,9),(44,'The maps for the transtubes were supposed to be updated last monthcycle but weren\'t. Cover us while we update the maps and records to show the update happened as planned.',2,9),(45,'The data shows a terrorist attack is supposed to hit today. Identify the threat, and make sure it\'s stopped.',8,10),(46,'Finally, a chance to embarrass those idiots at IntSec. Find what this supposed terrorist attack is supposed to be, and when it happens make sure IntSec take the blame.',1,10),(47,'Make sure the UltraSuperMegaBowl goes off without a hitch - broadcasting is on a 10 minute delay to the complex, it must not be interrupted.',3,10),(48,'Our techs have nicknamed today the MegaBowel, for obvious reasons. If there\'s anything in the pipes there may be problems. If it happens, don\'t let the blame fall on us.',5,10),(49,'Project ##SUB## is going ahead today, make sure it\'s a success!',7,6),(50,'##SUB## is likely to cause us to lose the need of heaps of reactors! Don\'t let it succeed!',6,6),(51,'The reactor isn\'t actually ready to go yet, we need engineers sent down before it gets switched on. Whatever happens, make sure at the end of the daycycle the new reactor is working.',6,11),(52,'We\'ve been refused access to the opening ceremony of the new reactor, but you should have no problem. Get our cameras into the opening ceremony and make sure it looks good.',3,11),(53,'We\'ve had this huge stock of radiation badges for over a yearcycle. Sell one to every citizen of the sector.',4,11),(54,'We just got word of a huge invasion force! Get at least four of our units into the fight!',1,12),(55,'We\'ve finally got a solid war coming. Get heaps of combat footage of our troops winning for the usual propaganda purposes.',3,12),(56,'We\'re going to war. Prevent any major damage to the sector, or make sure the other service groups get blamed for it.',5,12),(57,'We don\'t actually have enough laser barrels to go to war with. Either make more fast or find alterative ammo sources.',4,12),(58,'The flooding water may be fresh water! If it is, store it somewhere so we can bottle it and sell it for megacredits!',4,13),(59,'Mission quota is down. Send at least 5 troubleshooter teams on missions before the end of the daycycle.',9,NULL),(60,'That entire flooded area was almost condemned. Let it get destroyed so we can get a juicy demolition contract out of it.',5,13),(61,'This flooding is bad for morale. Implement a couple of initiatives to make the proles feel good about the flooding.',3,13),(62,'We have reliable information one of the High Programmers in the room is a traitor. Find them and have them terminated before end of daycycle.',8,NULL),(63,'There\'s been a sudden drop in the hygiene index, whatever the cause, make sure the blame is on tech services.',2,14),(64,'There\'s been a sudden loss of hygiene in the complex, our cleaners are still working fine. Make the blame land squarely on R&D.',5,14),(65,'We deployed a few dirt indexer bots last weekcycle and they work great! Make sure any blame for the loss of sector hygiene falls on CPU and not us.',7,14),(66,'The Computer\'s convinced that one of the other High Programmers is a traitor. If you don\'t prove that one is a traitor it\'ll blow a fuse.',2,NULL),(67,'We need more data on the effects of a nuclear meltdown, so we can test our new nuclear-proof underwear.',7,NULL),(68,'We need to close transtube ##ZON##-M4 for six months. Clear it with the other High Programmers and make sure they understand this will disrupt all transport in the sector.',6,NULL),(69,'##CIT-B-1## is one of our most decorated Vulture Troopers. Don\'t let treason be the public reason for his erasure.',1,15),(70,'##CIT-B-1## is an embarrassment to the complex, show him as an example that anyone can be a commie.',8,15),(71,'We need more exposure, ratings are falling. Get a high-profile citizen to go on at least two troubleshooter missions.',9,15),(72,'If ##CIT-B-1## is publicly denounced as treasonous it will be horrible for morale. Don\'t let that happen.',3,15),(73,'We\'re lagging behind on our High Profile Mutation Tracking. Find ##CIT-B-1##\'s mutation and have it registered before his erasure.',2,15),(74,'214-##SUB## is a commie weapon of mass destruction! Secure it and give it to us so we can study it!',7,16),(75,'Oh Computer, 214-##SUB## again? Make sure it\'s properly secured by us this time.',8,16),(76,'Everyone seems to be after 214-##SUB##. Make sure it\'s secured by us so we can replicate it and sell it to the other groups for massive profits!',4,16),(77,'Why are the other groups after 214-##SUB## anyway? Get it for us so we can sell it to the highest bidder!',6,16),(78,'Those Jackbooted idiots can\'t even keep one item under containment? Get 214-##SUB## for us, and we\'ll secure it properly this time.',1,16),(79,'MuchoMeat is one of our most profitable producers, don\'t let any serious damage come to it.',4,17),(80,'MuchoMeat is out-performing profit expectations. Bring it back within expectations.',2,17),(81,'MuchoMeat is full of expensive machinery, if things were to get broken there it would be extremely profitable for our techs. Make it profitable for our techs.',5,17),(82,'MuchoMeat uses far too much power. Halve their power consumption by the end of the daycycle.',6,17),(83,'##SUB## only has enough power for two firings, but the second will destroy the device. Stop people from using it more than once!',7,18),(84,'We\'re low on water. Use ##SUB## to pull water in from Jupiter\'s moon.',4,18),(85,'The enemy complex on the moon has always held a sword over our heads...until today! Use ##SUB## to destroy that complex!',1,18),(86,'There\'s an entrenched PURGE cell hiding deep underground, use ##SUB## to penetrate the fortress and eliminate the cell.',8,18),(87,'Something\'s going on with the computer\'s circuits...make sure FC doesn\'t terminate any of the HPs this daycycle so we can track down the problem.',5,19),(88,'The terrorist attack appears to be orchestrated by an Ultraviolet. Uncover this UV and have them terminated.',8,20),(89,'We have the Hatred Day Parade running tonight, make sure it\'s not interrupted.',3,21),(90,'The Parade usually brings out the commie rats. The arrest quota for today is 400% of normal, make sure we reach it.',8,21),(91,'PS aren\'t giving us the power we need for the parade lighting. Get it for us.',5,21),(92,'Our reactors are maxing out, reduce usage before one goes critical.',6,21),(93,'Vicky-B has an appearance later today, make sure she attends it before her disappearance.',1,22),(94,'The Big C has deterimined Vicky-B to be a traitor. Get her to us before her public appearance later this daycycle before she causes damage.',8,22),(95,'We still have tons of Vicky-B merchandise, make sure she is still a hero when this is all over.',4,22),(96,'Strike-Me-Not has suddenly become profitable, make sure it doesn\'t get shut down and stays under our control.',7,23),(97,'Strike-Me-Not is surpassing expectations. Make sure it gets shut down or gets transferred to us.',6,23),(98,'Strike-Me-Not is suddenly exceeding expectations, a sure sign of treason. Shut it down and have the staff interrogated.',8,23),(99,'When the exercise is over, make sure IntSec look incompetent while we look fantastic.',1,24),(100,'There\'ll be an invasion exercise today. Embarass the AF while making us look good.',8,24),(101,'We need to show the complex working together, get footage of at least 4 service groups working together to defend the complex.',3,24),(102,'We should take back ##CIT-V## by force! We must pre-emptively attack! Of course, clear it with the rest of the UVs first.',1,25),(103,'We should oversee the ##CIT-V## deal. Set up the deal, and make sure we get them back unharmed.',8,25),(104,'We need some good graces with FC, make sure a Troubleshooter Team oversees the transfer of ##CIT-V##.',9,25),(105,'We need to show R&D is still relevant in the fight against Communism, be sure our projects take a leading role in the upcoming exercise.',7,24),(106,'A staged commie attack means lots of repair work. Make sure all repair work is blamed on other SG\'s imcompetence, not on the exercise, or we\'ll have to pay the bill.',5,24),(107,'We should use this opportunity to move all our records to electronic sources. Convince FC to go full electronic!',2,26),(108,'CPU is going to try and make records go all electronic, stop it from happening, the power cost would be impossible.',6,26),(109,'Find a different medium than paper or electronic to put records on, and convince FC to use it to store all records. We\'ll make millions!',4,26),(110,'PLC is going to go silly over some new record storage material again, make sure it doesn\'t get implemented. Paper and Electronic are all we need.',3,26),(111,'We\'ve been trying to push for quantum storage for some time now, here\'s our chance. Convince FC to move all records to the new format.',7,26),(112,'R&D is going to push for quantum storage again, ever tried to convict someone on evidence they might be guilty? Yeah. Stop it from happening.',8,26);
