INSERT INTO `ssm` VALUES (1,1,NULL,'The muties have are getting too much peace, come down hard on mutants!'),(2,4,NULL,'Comrade! Pleasink to be spreadink Propaganda to Burgoise Complex!'),(3,5,NULL,'We\'re running out of washed caffiene. Can you deliver a truckload to ##LOC-1## for us?'),(4,6,NULL,'We have a surplus of cyborg parts, maim a good portion of the population so we can sell \'em off.'),(5,7,NULL,'Duuuude, we had a massive party last night and don\'t want to deal with the boys in blue... can you move IntSec out of the low clearance areas?'),(6,8,NULL,'We need more faith based initiatives...replace the morning anthem with a Hymn to our lord and savior, Friend Computer!'),(7,10,NULL,'There\'s too many bots around. Especially petbots, you can\'t sleep with those things around. Remove all petbots from the sector.'),(8,11,NULL,'Petbots are excellent for showing man\'s mastery over bots. Increase the number of petbots in the sector.'),(9,12,NULL,'Duuuuude, we had a massive rave last night, and we\'re out of uppers. Can you get us a transbotload of washed caffeine?'),(10,13,NULL,'We\'ve got a device we want to turn on but we don\'t know what it does. Can you get us unfettered access to a nuclear reactor to try?'),(11,15,NULL,'High value targets are currently under too much scrutiny, redirect IntSec to the lower-clearance areas.'),(12,16,NULL,'There\'s not enough pre-reckoning knowledge: get us onto the set of Celebrity Weekcycle and we\'ll do the rest.'),(13,19,NULL,'We need to tempt more clones with the wonders of the outdoors... can you get some trees into ##LOC-1##?'),(14,20,NULL,'La! The leylines intersect there, at ##LOC-1##! Build us a new temple there!'),(15,4,3,'Comrade! Ve are hearink rumours of superveapon gone missing! Recover and deliver veapon to us to aid great Lenin\'s cause.'),(16,8,3,'A heretical splinter group stole an experimental doomsday device and are hoarding it. Recover it for us so we can sanctify it before returning it.'),(17,9,NULL,'Yeah see, we got dis huge pile of defunct laser barrels. By huge, I\'s mean four million. Find us a buyer, and make sure IntSec\'s away.'),(18,2,NULL,'We\'re running low on armaments against the Commie threat! We need twenty tacnukes to beef up the arsenal by the end of the daycycle.'),(19,3,NULL,'We need more people to use our services. Kill off a high-profile citizen publicly to scare the masses.'),(20,17,NULL,'We\'ve got a secret escape route in ##LOC-1##, but there was a cave in. Repair it please.'),(21,21,NULL,'Comrade! We\'re going to hold a demonstration in the ##LOC-1##. Please make sure they don\'t run over us with tanks!'),(22,5,4,'The Big C\'s kinda...twitchy about the erasure for today, more so than usual. Get us your password so we can find out why.'),(23,3,4,'##CIT-V-TR## is a natural-born, no-one knows! Get us his spleen so we can use his genes.'),(24,20,4,'La! ##CIT-V-TR## is the sacrifice we need! Get them to us sedated! We\'ll be waiting in the ##LOC-SOC##.'),(25,17,4,'##CIT-V-TR## is a client of ours. Get him to us so we can get \'em out, we\'ll be at the ##LOC-RUN##.'),(26,12,4,'Whoa man, ##CIT-V-TR## paid well for a batch of RadicalMankey, but we can\'t find it, he must have eaten it. Get his stomach to use so we can pump the drugs back out.'),(27,7,1,'Whoa, the man\'s not keeping us down! Get us a pallet of B3 and a crate of WhiskeyLike to ##LOC-P## so we can throw a massive party!'),(28,12,1,'Whoa man! Like, we got space to breathe! Get us a load of Videoland to ##LOC-P## so we can rave, man!'),(29,3,1,'We haven\'t had any work all daycycle, it\'s costing us credits! Make a whole heap of clones die so we can get back to work.'),(30,2,1,'The commies have infiltrated IntSec! Get us five tacnukes so we can flush out the commie menace! We\'ll be waiting at the ##LOC-F##.'),(31,4,1,'Comrade! Ze IntSec veaklings are awaiting a blastink! Deliver us two hundred laser barrels so we can take ze fight to zem! We\'ll be waitink at ze ##LOC-F##'),(32,1,5,'Why are people tinkering with the human genome? Terminate ##CIT-G-SG##, he must be a filthy mutant.'),(33,3,5,'Why haven\'t we heard of ##SUB## before? Get us a copy of the data.'),(34,13,5,'##SUB## is actually working? Get us a copy of the data to look at'),(35,14,5,'The next step in human evolution is here! Get ##SUB## standardised.'),(36,9,5,'See here, dis ##SUB## project? Destroy the data, so\'s we don\'t lose our customer base later.'),(37,19,5,'##CIT-G-SG## is one of ours. Make sure his project succeeds!'),(40,2,7,'The Commies are finally attacking! Equip all clones with weapons to fight the impending Commie Horde!'),(41,4,7,'Comrade! Is not beink our superveapon! You be pinning blame on Beta Complex, yes?'),(42,5,7,'Yo dude, our electronics are going haywire! Whatever it is, make it stop.'),(43,13,7,'This is perfect time for some of our reanimation tests! Get us a safe way to the outdoors so we can try our latest experiment!'),(44,8,7,'The endtime prophecy has begun! Now we must part the RED sea! Destroy the Commie scum in Beta Complex!'),(45,20,7,'La! The old ones come to greet us! We must sacrifice a High Programmer to the elder gods to open the gate! Get us a suitable sacrifice!'),(46,19,7,'Outside is beautiful right now! Broadcast footage of it to the entire complex!'),(47,6,8,'The new petbot was influenced by us, get the next production run pushed through this daycycle.'),(48,4,8,'Comrade! Dis new petbot is symbol of capitalist excess! Remove from population!'),(49,5,8,'Our contract on the petbot is done, order the current stock to do a factory reset so they pay us again.'),(50,10,8,'These new bots are abominations! Reveal them for what they are and recall the whole product line!'),(51,13,8,'These new petbots so cute! Make them mandatory for all REDs and above!'),(52,7,9,'Cold Fun Syrup? Dude, get us a boxful! We can do some amazing pranks with it!'),(53,4,9,'Comrade! Ve must to be gettink hands on syrup of Cold Fun!'),(54,15,9,'Get us a good amount of that Cold Fun Syrup, we\'ll finally be able to make a bomb big enough to take down the Computer.'),(55,9,9,'Look see, gets us a box of Cold Fun Syrup and we\'ll cut youse in on de profits.'),(56,21,10,'Comrade! UltraSuperMegaBowl is capitalist excess! Cause an evacuation of the stadium!'),(57,15,10,'We have a bomb hidden under the UltraSuperMegaBowl, but security is too tight for us to activate it. Get us an alternate way in.'),(58,9,10,'Look see, we know there\'s something juicy under the UltraSuperMegaBowl. Get it for us and we\'ll cut you in on de profits.'),(59,14,NULL,'We\'re needing to find more of our kind, add more mutagenics to the water supply.'),(60,18,NULL,'We\'re needing building materials, specifically 5000 tons concrete. Deliver it to ##LOC-1## for us to pick up.'),(61,4,11,'Comrade! New reactor helping bourgoise cause! Must be destroyink!'),(62,21,11,'Comrade! New reactor helping bourgoise cause! Must be destroyink!'),(63,15,11,'The new reactor is a prime target. Destroy before the end of the daycycle.'),(64,1,11,'A new reactor means more mutants. Implement a new anti-mutant policy before the end of the daycycle!'),(65,14,11,'Get a crowd of people near the new reactor to celebrate its opening.'),(66,2,12,'We heard of the Commie threat! Send us some bigger guns so we can prepare for the final defence!'),(67,3,12,'We\'re gonna need some more cloning tanks. Appropriate some of tech services\' tanks for us.'),(68,18,12,'This is our chance. Get us a way to the front lines, and we\'ll end this war once and for all.'),(69,20,13,'La! The ritual is almost complete! Delay the computer\'s lackeys long enough so we may summon the old ones!'),(70,12,13,'We kinda lost a year\'s supply of hallucinogenics in the water supply. Can you get it back for us? '),(71,8,13,'We\'ve heard rumblings of heretical cultists building a temple in the sublevels. Destroy it and escort us there to cleanse it!'),(72,18,13,'Some idiots stole our building supplies and built a temple in the sublevels. Can you clear them out, but leave the place intact for us to strip?'),(73,10,14,'These new dirt indexer bots are terrible murderers! Destroy all of them!'),(74,6,14,'The dirt indexer bots are the next wave of bot freedom fighters. Get more out in the sector!'),(75,11,14,'One of the dirt indexer bots murdered a clone! Get footage of this and broadcast it to the complex!'),(76,15,15,'##CIT-B-1## wasn\'t a commie, they were one of ours. Get one of their clones to disappear into our hands before their erasure.'),(77,11,15,'##CIT-B-1## is due to be erased? They were one of our best clones! Get one of their clones to disappear before his erasure.'),(78,3,15,'We could do wonderful things with ##CIT-B-1##, get them delivered comatose to us at ##LOC-1##'),(79,2,15,'##CIT-B-1## can\'t be a traitor, they\'ve killed far too many commies. We\'ve a shipment of weaponry for him, pick it up at ##LOC-1## and deliver it to them.'),(80,5,15,'We need ##CIT-B-1##\'s tongue for identity purposes. Deliver it to us at ##CIT-B-1##.'),(81,8,15,'##CIT-B-1## is a commie? Their soul just needs cleansing, deliver them to us so we may do so. We\'ll be waiting at ##LOC-1##'),(82,4,15,'##CIT-B-1## is comrade? Vhy ve not know? Beink savink them and deliverink to us, yes? Ve vait at ##LOC-1##'),(83,21,15,'##CIT-B-1## is comrade? Must be very skilled. You be savink them and deliver to ##LOC-1## for us, yes?'),(84,4,16,'Comrade! My book finally returns! Re-secure ##SUB## for my coll...for future generations of Communists!'),(85,2,16,'This ##SUB## thing is a commie weapon! Broadcast its destruction to the complex.'),(86,11,16,'There\'s a wonderful item, ##SUB##, which will assist in the coming revolution. Capture it for us.'),(87,1,16,'There is a mutie killing device, ##SUB##, get it for us.'),(88,14,16,'We\'ve recently found ##SUB## is a major mutagenic, secure it for us.'),(89,7,16,'Whoa man, everyone seems to be after ##SUB##. Grab it for us and we\'ll pull the greatest stunt anyone has ever seen!'),(90,9,16,'Look see, there\'s dis really expensive ##SUB## running around, get it for us and we\'ll sell it to the highest bidder, capiche?'),(91,3,17,'Have the staff of MuchoMeat terminated, so their clones will buy our insurance this time.'),(92,4,17,'Comrade! MuchoMeat is symbol of capitalist excess! You are to be putting poison in MuchoMeat foodstuffs, yes?'),(93,11,17,'We require a crate of MuchoMeat\'s products to help the revolution. Deliver it to us at ##LOC-1##'),(94,6,17,'MuchoMeat doesn\'t use enough bots. Execute the lower-level staff and have them replaced with bots instead.'),(95,10,17,'MuchoMeat uses too many bots. Destroy all the bots and replace them with humans.'),(96,19,17,'MuchoMeat grows things from the outdoors, I think they\'re called Pugs, in vats. Get one of them for us, we\'ll be at ##LOC-1##.'),(97,13,18,'Get us the plans to ##SUB## so we can make our own device!'),(98,17,18,'Get us the plans to ##SUB## so we can make our own!'),(99,19,18,'Get us the plans to ##SUB## so we can make our own exits.'),(100,20,18,'La! Get us the plans to ##SUB## so we can open a true gate!'),(101,9,18,'Lookee here, get us deez here plans to ##SUB##, and we sells dem to the highest bidder, capiche?'),(102,8,19,'We\'ve noticed a drop in our lord\'s response times. Get us into one of the CompNodes to sanctify its circuites.'),(103,13,19,'We\'ve had advance warning of more compnodes, get one of our teams into a partially constructed CompNode.'),(104,15,20,'We\'re taking out ##LOC-1##, clear the IntSec goons out of there.'),(105,11,20,'We\'re bombing ##LOC-2##, remove the resistance for us.'),(106,4,20,'Comrade! Ve are bomink ##LOC-3##. Pleasink to be removink resistance.'),(107,8,20,'The heathens are coming for our temple near ##LOC-1##! Stop them and don\'t let our temple get discovered!'),(108,6,20,'We\'ve got a bot shop near ##LOC-2## that someone\'s trying to bomb. Stop them and keep our shop hidden.'),(109,2,20,'The commies are coming for our bunker 